export class IcfesTest {
  constructor() {
    this.questions = new Array();
    this.qtyCorrectQuestions = 0;
  }

  calculateQtyCorrectQuestions() {
    this.qtyCorrectQuestions = 0;
    this.questions.forEach(question => {
      if (question.checkAnswerPoints() > 0) {
        this.qtyCorrectQuestions += 1;
      }
    });
  }

}
